(1, 1101, 'Terampil', 1, 'I.A.1', 'I. PENDIDIKAN ', 'I.A. Pendidikan Sekolah dan Memperoleh Ijazah/Gelar ', 'Diploma III (DIII) ', 'Pendidikan Sekolah dan Memperoleh Ijazah/Gelar : Diploma III (DIII) ', '', 'Ijazah', '1. Fotocopy ijazah dan transkrip (daftar nilai dari mata kuliah yang ditempuh) yang dilegalisir oleh instansi yang berwenang sesuai dengan peraturan dan ketentuan yang berlaku bagi pengangkatan pertama dan peningkatan pendidikan.\r\n2. Fotocopy Surat Tugas atau Ijin Belajar bagi Statistisi yang meningkatkan pendidikan, dan ketentuan lain yang dipersyaratkan.\r\n', '60.000', 'Semua Jenjang', 'Pendidikan sekolah dimaksud adalah pendidikan formal baik di dalam maupun di luar negeri pada sekolah lanjutan tingkat atas atau perguruan tinggi atau setara yang diakreditasi oleh kementerian yang berwenang. Angka kredit yang diberikan kepada statistisi yang memperoleh gelar jenjang lebih tinggi adalah selisih antara angka kredit gelar/ijazah yang lebih tinggi dengan ijazah yang pernah dinilai sebelumnya. Apabila memperoleh gelar atau ijazah di luar bidang statistik dan bidang lain di luar kualifikasi yang ditetapkan oleh Kepala BPS, maka pendidikannya diperhitungkan sebagai unsur penunjang. Penilaian ijazah SLTA s.d. DII ini hanya berlaku bagi statistisi yang diangkat pertama kali sebelum tanggal 4 Februari 2014. Satuan hasil : Ijazah Angka Kredit : 1.Diploma III (DIII) : 60 ', '60.0000', '60.000', '60.000', '0.000', '0.000', '0.000', 'Semua', 'Semua'),
