(56, 7700, 'Terampil', 1, 'II.C.1', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.C. Pengolahan ', 'II.C.1. Melakukan validasi pengolahan secara manual ', 'Validasi manual ', '', 'Halaman', 'Laporan jumlah halaman kesalahan yang telah divalidasi yang dilegalisasi atasan ', '0.015', 'Penyelia', 'Melakukan validasi pengolahan secara manual adalah kegiatan memeriksa konsistensi antar pertanyaan, kewajaran isian, alur pengisian, dan memperbaiki hasil entry data dengan melihat isian dokumen. Kegiatan ini sering juga disebut secondary editing. Penghitungan angka kredit didasarkan pada jumlah halaman kesalahan yang dicetak. ', '0.0000', '0.012', '0.015', '0.000', '0.000', '0.000', 'Semua', 'Semua'),
(57, 8000, 'Terampil', 1, 'II.C.2', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.C. Pengolahan ', 'II.C.2. Memindahkan data ke media komputer (entri data) ', 'Entri data', '', 'Halaman', 'Laporan jumlah halaman atau jumlah karakter yang dientri dan contoh kuesioner yang dientri ', '0.002', 'Pelaksana Lanjutan', 'Memindahkan data ke media komputer (entri data) adalah memindahkan isian dokumen ke media komputer dalam hitungan karakter. Penghitungan angka kredit didasarkan pada jumlah halaman. Dalam hal ini 1 (satu) halaman setara dengan 250 karakter yang dientri. Khusus untuk automated data entry (menggunakan scanner), penghitungan angka kredit didasarkan atas kecepatan scanner dalam dokumen per jam (s), dan jumlah dokumen yang dikerjakan (d). Rumus yang digunakan: (0,00468 xd)', '0.0016', '0.002', '0.002', '0.000', '0.000', '0.000', 'Semua', 'Semua'),
(58, 8300, 'Terampil', 1, 'II.C.3', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.C. Pengolahan ', 'II.C.3. Melakukan pengolahan data sekunder secara manual ', 'Pengolahan manual ', '', 'Halaman', 'Laporan jumlah halaman atau jumlah karakter yang dientri dan contoh kuesioner yang dientri ', '0.006', 'Pelaksana', 'Melakukan pengolahan data sekunder secara manual adalah melakukan pengolahan data sekunder ke dalam bentuk tabel yang akan disajikan (retabulasi). ', '0.0060', '0.006', '0.006', '0.000', '0.000', '0.000', 'Semua', 'Semua'),
(59, 8501, 'Terampil', 1, 'II.D.1', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.D. Penyajian dan Publikasi ', 'II.D.1. Membuat peta tematik manual kegiatan ', 'Membuat peta tematik manual kegiatan ', '', 'Tema Tampilan', 'Laporan jumlah pembuatan peta tematik yang dilegalisasi atasan ', '0.012', 'Pelaksana', 'Membuat peta tematik manual kegiatan adalah membuat peta dengan muatan informasi tertentu. Peta tematik adalah peta wilayah dengan dilengkapi informasi data hasil kegiatan. Informasi yang ditampilkan dapat berupa jumlah atau simbol dari penduduk, tanaman, hewan, hotel, dan lain lain. ', '0.0120', '0.012', '0.012', '0.000', '0.000', '0.000', 'Semua', 'Semua'),
(60, 8510, 'Terampil', 1, 'II.D.2', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.D. Penyajian dan Publikasi ', 'II.D.2. Merancang/membuat papan monografi ', 'Merancang/membuat papan monografi ', '', 'Tabel (papan monografi)', 'Laporan pembuatan papan monografi yang dilengkapi dengan surat tugas ', '0.045', 'Pelaksana Lanjutan', 'Merancang/membuat papan monografi adalah menyajikan informasi hasil kegiatan sensus, survei, data sekunder atau hasil observasi dalam bentuk tabel atau grafik pada media dinding yang mudah dilihat atau dibaca. ', '0.0360', '0.045', '0.045', '0.000', '0.000', '0.000', 'Semua', 'Semua'),
(61, 8520, 'Terampil', 1, 'II.D.3', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.D. Penyajian dan Publikasi ', 'II.D.3. Memeriksa tabel publikasi tingkat kecamatan ', 'Memeriksa tabel tingkat kecamatan ', '', 'Tabel', 'Laporan jumlah tabel yang diperiksa dan daftar tabel yang dilegalisasi atasan', '0.010', 'Pelaksana Lanjutan', 'Memeriksa tabel publikasi tingkat kecamatan adalah memeriksa kelengkapan dan konsistensi isian antar sel dalam tabel atau antar tabel, yang dibuat oleh petugas lain, yang akan disajikan untuk publikasi kecamatan. Dalam butir kegiatan ini termasuk kegiatan membuat tabel secara manual (bukan dengan program). ', '0.0080', '0.010', '0.010', '0.000', '0.000', '0.000', 'Semua', 'Semua'),
(62, 8530, 'Terampil', 1, 'II.D.4', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.D. Penyajian dan Publikasi ', 'II.D.4. Menyusun publikasi statistik tingkat kecamatan ', 'Menyusun publikasi tingkat kecamatan ', '', 'Buku', 'Fotokopi cover publikasi dan daftar isi buku yang dibuat dan telah dilegalisasi oleh atasan', '1.000', 'Pelaksana Lanjutan', 'Menyusun publikasi statistik tingkat kecamatan adalah kegiatan menyusun tata letak tabel, ulasan, dan grafik secara sistematis yang akan dipublikasikan dalam bentuk buku pada tingkat kecamatan baik hardcopy maupun softcopy. ', '0.8000', '1.000', '1.000', '0.000', '0.000', '0.000', 'Semua', 'Semua'),
(63, 8540, 'Terampil', 1, 'II.D.5', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.D. Penyajian dan Publikasi ', 'II.D.5. Menyusun ringkasan eksekutif tingkat kecamatan ', 'Menyusun ringkasan eksekutif tingkat kecamatan ', '', 'Buku (termasuk dalam bentuk naskah)', 'Foto kopi naskah yang dilegalisasi oleh atasan ', '0.100', 'Pelaksana Lanjutan', 'Menyusun ringkasan eksekutif tingkat kecamatan adalah kegiatan membuat dan menyusun ulasan ringkas hasil kegiatan statistik di tingkat kecamatan. ', '0.0800', '0.100', '0.100', '0.000', '0.000', '0.000', 'Semua', 'Semua'),
(64, 8601, 'Terampil', 1, 'III.A.1.6', 'III. ANALISIS DAN PENGEMBANGAN STATISTIK ', 'III.A. Analisis Statistik ', 'III.A.1. Melakukan Analisis Sederhana Satu Sektor ', 'Melakukan Analisis Sederhana Satu Sektor : Sesuai ketentuan', 'Sesuai ketentuan', 'Buku', 'Foto copy naskah atau cover, kata pengantar dan daftar isi yang dilegalisasi atasan. ', '1.200', 'Penyelia', 'Analisis statistik sederhana satu sektor adalah penguraian suatu sektor atas berbagai bagiannya dan penelaahan bagian itu sendiri untuk memperoleh gambaran yang jelas. Yang dimaksud dengan sektor adalah lingkup permasalahan yang dianalisis. Contoh: sektor pendidikan, sektor tenaga kerja, sektor perdagangan, sektor pertanian, dan lain lain. ', '0.0000', '0.960', '1.200', '0.000', '0.000', '0.000', 'Semua', 'Semua'),
(65, 8701, 'Terampil', 1, 'III.B.1', 'III. ANALISIS DAN PENGEMBANGAN STATISTIK ', 'III.B. Pengembangan Statistik ', 'III.B.1.Memberikan Konsultasi Statistik Dalam Rangka Penyusunan Statistik Kelembagaan Pada Tingkat Dasar ', 'Memberikan Konsultasi Statistik Dalam Rangka Penyusunan Statistik Kelembagaan Pada Tingkat Dasar : ', '', 'Pertemuan', 'Laporan pemberian konsultasi statistik kelembagaan tingkat dasar dilegalisasi atasan ', '0.150', 'Penyelia', 'Memberikan konsultasi statistik dalam rangka penyusunan statistik kelembagaan pada tingkat dasar adalah kegiatan memberikan masukan dan bimbingan/asistensi dalam penerapan ilmu statistik yang meliputi antara lain penyiapan pengumpulan data, pengumpulan data, pengolahan data dan analisis data dengan tujuan penyempurnaan dan pengembangan statistik kelembagaan. ', '0.0000', '0.120', '0.150', '0.000', '0.000', '0.000', 'Semua', 'Semua'),
(66, 8802, 'Terampil', 1, 'III.B.2', 'III. ANALISIS DAN PENGEMBANGAN STATISTIK ', 'III.B. Pengembangan Statistik ', 'III.B.2.Melakukan Penyebarluasan Hasil Pengumpulan Data Statistik Dalam Rangka Evaluasi Kegiatan Kelembagaan Dalam Bidang Statistik Tingkat Dasar ', 'Melakukan Penyebarluasan Hasil Pengumpulan Data Statistik Dalam Rangka Evaluasi Kegiatan Kelembagaan Dalam Bidang Statistik Tingkat Dasar : ', '', 'Pertemuan', 'Laporan penyebarluasan hasil pengumpulan data statistik kelembagaan tingkat dasar yang dilegalisasi atasan', '0.030', 'Penyelia', 'Melakukan penyebarluasan hasil pengumpulan data statistik dalam rangka evaluasi kegiatan kelembagaan dalam bidang statistik dasar adalah suatu kegiatan yang bertujuan untuk mensosialisasikan hasil suatu kegiatan statistik dengan tingkat statistik dasar yang berguna untuk lembaga yang bersangkutan. ', '0.0000', '0.024', '0.030', '0.000', '0.000', '0.000', 'Semua', 'Semua'),
(67, 9001, 'Terampil', 1, 'IV.A.1.a', 'IV. PENGEMBANGAN PROFESI STATISTISI ', 'IV.A. Pembuatan karya tulis/karya ilmiah di bidang statistik ', 'IV.A.1.Membuat karya tulis/karya ilmiah, hasil penelitian, pengkajian survei dan atau evaluasi di bidang statistik yang dipublikasikan: ', 'Membuat karya tulis/karya ilmiah, hasil penelitian, pengkajian survei dan atau evaluasi di bidang statistik yang dipublikasikan: Dalam bentuk buku yang diterbitkan dan diedarkan secara nasional/internasional ', 'Penulis Tunggal', 'Buku', 'Buku yang sudah diterbitkan ', '12.500', 'Semua Jenjang', 'Penilaian umum : Karya tulis/karya ilmiah yang ditulis oleh 2 (dua) orang, pembagian angka kreditnya adalah 60% (enam puluh persen) untuk penulis utama dan 40% (empat puluh persen) untuk penulis pembantu. Karya tulis/karya ilmiah yang ditulis oleh 3 (tiga) orang, pembagian angka kreditnya adalah 50% (lima puluh persen) untuk penulis utama dan masing masing 25 % (dua puluh lima persen) untuk penulis pembantu. Karya tulis/karya ilmiah yang ditulis oleh 4 (empat) orang, pembagian angka kreditnya adalah 40% (empat puluh persen) untuk penulis utama dan 20% untuk masing masing penulis pembantu dibagi sama rata. ', '12.5000', '12.500', '12.500', '0.000', '0.000', '0.000', 'Semua', 'Semua'),
