(98, 9616, 'Terampil', 1, 'V.G.b', 'V. PENUNJANG KEGIATAN STATISTISI ', 'V.G. Perolehan gelar kesarjanaan lainnya ', 'Sarjana Muda/Diploma III', 'Perolehan gelar kesarjanaan lainnya : Sarjana Muda/Diploma III', '', 'Gelar/Ijazah', 'Fotokopi ijazah kesarjanaan dan transkrip yang telah dilegalisir instansi yang berwenang sesuai denganKetentuan yang berlaku serta surat tugas/ijin belajar. ', '3.000', 'Semua Jenjang', 'Gelar kesarjanaan lainnya adalah gelar kesarjanaan yang diperoleh oleh fungsional statistisi yang tidak sesuai dengan bidang tugasnya. Apabila suatu instansi/unit statistik memiliki kualifikasi pendidikan (jurusan) yang secara spesifik ditetapkan sebagai jurusan yang diperlukan bagi dan sesuai dengan bidantg tugas statistisi di lingkungan instansi/unit statistisi yang bersangkutan, maka yang dimaksud dengan ?memperoleh gelar kesarjanaan lainnya? adalah perolehan gelar yang tidak sesuai dengan bidang tugas Statistisi. Apabila suatu instansi/unit statistisi tidak menetapkan kualifikasi pendidikan (jurusan) tertentu sebagai ?jurusan yang diperlukan? bagi dan ?sesuai dengan bidang tugas? Statistisi, maka angka kredit yang diberikan untuk perolehan gelar kesarjanaan mengacu kepada ketentuan penilaian untuk unsur pendidikan sebagai bagian Kegiatan Utama. ', '3.0000', '3.000', '3.000', '0.000', '0.000', '0.000', 'Semua', 'Semua'),
