(100, 2001, 'Ahli', 2, 'II.A.1.', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.A. Persiapan ', 'II.A.1. Mengumpulkan bahan/informasi pendukung untuk kegiatan statistik ', 'Mengumpulkan bahan/informasi pendukung untuk kegiatan statistik ', '', 'Bahan Acuan', 'Laporan berisi jumlah dokumen, literatur atau pustaka yang dikumpulkan terkait dengan kegiatan statistik dan surat tugas dari atasan ', '0.500', 'Pertama', 'Kegiatan pengumpulan bahan/informasi pendukung untuk kegiatan statistik meliputi kegiatan pengumpulan literatur atau pustaka, website, kompilasi hasil pengamatan, opini atau hasil penelitian serupa sebelumnya. Hasil kegiatan ini berupa dokumen, literatur atau pustaka terkait kerangka kerja konseptual, kerangka kerja operasional, konsep/konstruk, definisi, dan pengukuran statistik. Penilaian angka kredit dihitung menurut banyaknya kegiatan bukan berdasarkan banyaknya dokumen, literatur atau pustaka. ', '0.0000', '0.000', '0.000', '0.500', '0.500', '0.500', 'Semua', 'Semua'),
(101, 2051, 'Ahli', 2, 'II.A.2.', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.A. Persiapan ', 'II.A.2. Menelaah bahan/informasi pendukung untuk kegiatan statistik ', 'Menelaah bahan/informasi pendukung untuk kegiatan statistik ', '', 'Bahan Acuan', 'Ringkasan hasil telaah untuk kegiatan statistik tertentu yang telah dilegalisasi oleh atasan ', '1.500', 'Muda', 'Kegiatan pengumpulan bahan/informasi pendukung untuk kegiatan statistik meliputi kegiatan pengumpulan literatur atau pustaka, website, kompilasi hasil pengamatan, opini atau hasil penelitian serupa sebelumnya. Hasil kegiatan ini berupa dokumen, literatur atau pustaka terkait kerangka kerja konseptual, kerangka kerja operasional, konsep/konstruk, definisi, dan pengukuran statistik. Penilaian angka kredit dihitung menurut banyaknya kegiatan bukan berdasarkan banyaknya dokumen, literatur atau pustaka. Jika Statistisi yang menelaah sekaligus mengumpulkan bahan/informasi pendukung untuk kegiatan statistik maka yang dinilai hanya kegiatan penelaahan. ', '0.0000', '0.000', '0.000', '1.200', '1.500', '1.500', 'Semua', 'Semua'),
(102, 2100, 'Ahli', 2, 'II.A.3.', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.A. Persiapan ', 'II.A.3. Membuat rencana tabulasi kegiatan statistik ', 'Membuat rencana tabulasi ', '', 'Dummy Tabel', 'Laporan berupa jumlah dummy tabel untuk kegiatan statistik yang dilegalisasi oleh atasan ', '0.016', 'Pertama', 'Membuat rencana tabulasi kegiatan statistik adalah kegiatan merancang struktur tabel hasil kegiatan statistik. Angka kredit dihitung menurut banyaknya dummy tabel untuk suatu kegiatan statistik. ', '0.0000', '0.000', '0.000', '0.016', '0.016', '0.016', 'Semua', 'Semua'),
(103, 2200, 'Ahli', 2, 'II.A.4.', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.A. Persiapan ', 'II.A.4. Mengikuti pembahasan kuesioner dan instrumen lainnya pada kegiatan statistik ', 'Mengikuti pembahasan kuesioner dan instrumen lainnya', '', 'Pertemuan', 'Surat undangan, laporan hasil rapat (notulensi hasil rapat) dan fotokopi daftar hadir yang dilegalisasi atasan ', '0.100', 'Pertama', 'Kegiatan pembahasan kuesioner dan instrumen lainnya pada kegiatan statistik adalah kegiatan yang melibatkan beberapa orang untuk bekerja bersama sama dalam bentuk rapat atau konsinyering dalam rangka membahas dan menyusun kuesioner dan instrumen lain (daftar sampel, peta blok sensus, dan lain lain). Kegiatan rapat atau konsinyering yang tidak membahas materi kuesioner dan instrumen kegiatan statistik tidak termasuk dalam penilaian angka kredit. Satu pertemuan setara dengan 8 (delapan) jam. ', '0.0000', '0.000', '0.000', '0.100', '0.100', '0.100', 'Semua', 'Semua'),
(104, 2300, 'Ahli', 2, 'II.A.5.', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.A. Persiapan ', 'II.A.5. Mengikuti pembahasan penyusunan pedoman kegiatan statistik ', 'Mengikuti pembahasan kuesioner dan instrumen lainnya', '', 'Pertemuan', 'Surat undangan, laporan hasil rapat (notulensi hasil rapat) dan fotokopi daftar hadir yang dilegalisasi atasan ', '0.100', 'Pertama', 'Kegiatan pembahasan penyusunan pedoman kegiatan statistik adalah kegiatan yang melibatkan beberapa orang untuk bekerja bersama sama dalam bentuk rapat atau konsinyering dalam rangka membahas dan menyusun buku pedoman bagi kegiatan statistik tertentu yang direncanakan. Kegiatan rapat atau konsinyering yang tidak membahas materi buku pedoman kegiatan statistik tidak termasuk dalam penilaian angka kredit. Satu pertemuan setara dengan 8 (delapan) jam. ', '0.0000', '0.000', '0.000', '0.100', '0.100', '0.100', 'Semua', 'Semua'),
(105, 2420, 'Ahli', 2, 'II.A.6.d', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.A. Persiapan ', 'II.A.6. Melaksanakan kegiatan sampling ', 'Sampling d. Memilih sampel ', '', 'Daftar sampel', 'Laporan berisi daftar sampel yang dilegalisasi oleh atasan ', '0.050', 'Pertama', 'Kegiatan pemilihan sampel adalah kegiatan untuk memilih sampel dari kerangka sampel menggunakan aplikasi/program pemilihan sampel ataupun secara manual. Hasil kegiatan ini berupa daftar sampel yang nantinya akan digunakan untuk pendataan lapangan. Angka kredit dinilai berdasarkan banyaknya kegiatan dan bukan berdasarkan banyaknya sampel yang dipilih. Dalam kegiatan ini termasuk memilih sampel dengan cara mengalokasikan sampel. ', '0.0000', '0.000', '0.000', '0.050', '0.050', '0.050', 'Semua', 'Semua'),
(106, 2480, 'Ahli', 2, 'II.A.6.e', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.A. Persiapan ', 'II.A.6. Melaksanakan kegiatan sampling ', 'Sampling e. Memperbaharui (updating) kerangka sampel ', '', 'unit ter-update', 'Laporan berisi kerangka sampel terbaharui yang dilegalisasi oleh atasan ', '0.001', 'Pertama', 'Kegiatan memperbaharui kerangka sampel adalah kegiatan updating kerangka sampel yang dilakukan secara berkala dan sewaktu waktu. Pembaharuan kerangka sampel dilakukan untuk menjamin diperolehnya kerangka sampel menurut kondisi terkini sehingga sampel yang akan dipilih akan merepresentasikan kondisi terkini. Angka kredit dihitung berdasarkan banyaknya unit sampling pada kerangka sampel yang telah dimutakhirkan (mengalami perubahan). ', '0.0000', '0.000', '0.000', '0.001', '0.001', '0.001', 'Semua', 'Semua'),
(107, 2500, 'Ahli', 2, 'II.A.7.a', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.A. Persiapan ', 'II.A.7. Melaksanakan kegiatan dalam lingkup observasi ', 'Melaksanakan kegiatan dalam lingkup observasi a. Penyusunan kerangka sampel ', '', 'Kerangka sampel', 'Contoh daftar kerangka sampel yang dilegalisasi oleh atasan ', '0.500', 'Pertama', 'Kegiatan penyusunan kerangka sampel adalah kegiatan untuk membuat daftar unit populasi untuk suatu kegiatan observasi. Daftar unit populasi tersebut merupakan kerangka sampel yang dijadikan acuan dalam pemilihan sampel menurut kaidah sampling tertentu. Angka kredit dihitung menurut banyaknya kegiatan dan bukan berdasarkan banyaknya unit sampel. ', '0.0000', '0.000', '0.000', '0.500', '0.500', '0.500', 'Semua', 'Semua'),
(108, 2521, 'Ahli', 2, 'II.A.7.b', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.A. Persiapan ', 'II.A.7. Melaksanakan kegiatan dalam lingkup observasi ', 'Melaksanakan kegiatan dalam lingkup observasi b. Monitoring dan evaluasi penerimaan daftar sampel ', '', 'Bahan acuan', 'Laporan hasil monitoring dan evaluasi penerimaan daftar sampel yang dilegalisasi oleh atasan ', '0.200', 'Pertama', 'Kegiatan monitoring dan evaluasi penerimaan daftar sampel adalah pemantauan penerimaan dan evaluasi daftar sampel beserta permasalahan dari lapangan. Laporan kegiatan berupa hasil monitoring dan evaluasi beserta permasalahannya berdasarkan bahan acuan dari lapangan. ', '0.0000', '0.000', '0.000', '0.200', '0.200', '0.200', 'Semua', 'Semua'),
(109, 2541, 'Ahli', 2, 'II.A.7.c', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.A. Persiapan ', 'II.A.7. Melaksanakan kegiatan dalam lingkup observasi ', 'Melaksanakan kegiatan dalam lingkup observasi c. Pengelolaan dan penyempurnaan master file ', '', 'Desa ter-update (termasuk unit populasi lain)', 'Laporan terkait hasil pengelolaan dan penyempurnaan master file yang dilegalisasi oleh atasan ', '0.030', 'Pertama', 'Yang dimaksud dengan desa ter update adalah master file desa yang mengalami perubahan baik nama desa maupun muatannya (misalnya jumlah blok sensus, jumlah rumah tangga, dsb). Dalam kegiatan ini termasuk pengelolaan dan penyempurnaan master file dalam lingkup sensus/survei. Kegiatan pengelolaan dan penyempurnaan master file adalah kegiatan statistik untuk mengelola sekaligus menyempurnakan master file wilayah. Master file wilayah meliputi berbagai jenjang wilayah administrasi pemerintahan seperti provinsi, kabupaten/kota, kecamatan, desa/kelurahan dan bahkan blok sensus. Pengelolaan master file dilakukan secara berkala dan sewaktu-waktu. Angka kredit dihitung berdasarkan banyaknya kegiatan dan bukan berdasarkan banyaknya master file wilayah ataupun banyaknya wilayah. ', '0.0000', '0.000', '0.000', '0.030', '0.030', '0.030', 'Semua', 'Semua'),
(110, 2561, 'Ahli', 2, 'II.A.7.d', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.A. Persiapan ', 'II.A.7. Melaksanakan kegiatan dalam lingkup observasi ', 'Melaksanakan kegiatan dalam lingkup observasi d. Penentuan metode penarikan sampel ', '', 'Metode', 'Naskah metode pemilihan sampel dan prosedur estimasi yang dilegalisasi oleh atasan. ', '0.550', 'Pertama', 'Kegiatan penentuan metode penarikan sampel adalah kegiatan statistik untuk menentukan tata cara penarikan sampel dari kerangka sampel dan membuat prosedur estimasi yang sesuai dengan metode sampling yang digunakan pada suatu observasi. Angka kredit dinilai berdasarkan banyaknya kegiatan dan bukan berdasarkan banyaknya metode yang digunakan. Menentukan metode penarikan sampel diperhitungkan angka kreditnya apabila merupakan metode baru atau ada perubahan dari metode yang digunakan sebelumnya. ', '0.0000', '0.000', '0.000', '0.550', '0.550', '0.550', 'Semua', 'Semua');
INSERT INTO `fungsional` (`id_fungsional`, `kode`, `tingkat`, `kode_tingkat`, `kode_perka`, `unsur`, `sub_unsur`, `butir`, `uraian_singkat`, `kegiatan`, `satuan_hasil`, `bukti_fisik`, `angka_kredit`, `pelaksana_kegiatan`, `keterangan`, `pelaksana`, `pelaksana_lanjutan`, `penyelia`, `pertama`, `muda`, `madya`, `bidang`, `seksi`) VALUES
(111, 2601, 'Ahli', 2, 'II.A.8.', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.A. Persiapan ', 'II.A.8. Menghitung sampling error kegiatan statistik ', 'Menghitung sampling error kegiatan statistik ', '', 'Kegiatan ', 'Naskah hasil penghitungan dan telaah sampling error yang dilegalisasi oleh atasan ', '1.200', 'Madya', 'Menghitung sampling error kegiatan statistik adalah menghitung dan menelaah sampling error (tingkat kesalahan estimasi yang disebabkan oleh metode pemilihan sampel) sesuai dengan metode sampling yang digunakan pada suatu kegiatan statistik. ', '0.0000', '0.000', '0.000', '0.000', '0.960', '1.200', 'Semua', 'Semua'),
(112, 2700, 'Ahli', 2, 'II.A.9.', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.A. Persiapan ', 'II.A.9. Menghitung penimbang dalam rangka estimasi kegiatan statistik ', 'Menghitung penimbang dalam rangka estimasi kegiatan statistik ', '', 'Daftar penimbang', 'Naskah penghitungan penimbang dan evaluasinya yang dilegalisasi oleh atasan ', '1.300', 'Muda', 'Menghitung penimbang dalam rangka estimasi kegiatan statistik adalah menghitung bobot bagi setiap sampel berdasarkan rancangan survei dan metode sampling yang digunakan dan mengevaluasi hasilnya. Bobot/penimbang/faktor pengali yang dimaksud adalah suatu bilangan yang digunakan sebagai pengali untuk memperkirakan nilai parameter tertentu sesuai dengan metode pemilihan sampel yang digunakan. Angka kredit dihitung berdasarkan banyaknya kegiatan statistik. ', '0.0000', '0.000', '0.000', '1.040', '1.300', '1.300', 'Semua', 'Semua'),
(113, 3500, 'Ahli', 2, 'II.A.14.', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.A. Persiapan ', 'II.A.14. Meneliti peta analog observasi (manual) ', 'Meneliti peta analog observasi (manual) ', '', 'Peta', 'Surat tugas dan laporan meneliti peta yang dilegalisasi atasan ', '0.030', 'Pertama', 'Sketsa peta wilayah objek statistik (Peta Analog) adalah peta yang dibuat secara manual dengan mengamati langsung ke objek yang akan digambar, baik menggunakan peta dasar ataupun tidak. Meneliti peta analog observasi (manual) adalah meneliti batas batas dan legenda dari peta yang dibuat secara manual apakah sudah benar atau belum. ', '0.0000', '0.000', '0.000', '0.030', '0.030', '0.030', 'Semua', 'Semua'),
(114, 3600, 'Ahli', 2, 'II.A.15.', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.A. Persiapan ', 'II.A.15. Meneliti peta indeks kegiatan statistik ', 'Meneliti peta indeks kegiatan statistik ', '', 'Peta', 'Surat tugas dan laporan banyaknya peta indeks yang diteliti yang dilegalisasi atasan ', '0.005', 'Muda', 'Meneliti peta indeks kegiatan statistik adalah kegiatan meneliti termasuk memeriksa urutan kode wilayah, batas batas dan legenda dari peta indeks apakah sudah benar sesuai dengan keadaan terkini yang dibuat berdasar-kan hasil kegiatan statistik. ', '0.0000', '0.000', '0.000', '0.004', '0.005', '0.005', 'Semua', 'Semua'),
(115, 3700, 'Ahli', 2, 'II.A.16.', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.A. Persiapan ', 'II.A.16. Membuat peta digital ', 'Membuat peta digital ', '', 'Peta', 'Surat tugas dan laporan banyaknya peta digital yang dibuat yang dilegalisasi atasan ', '0.010', 'Pertama', 'Peta Digital adalah peta yang terdiri dari sekumpulan file yang memuat unsur dasar pembuatan peta, yaitu titik, garis, serta ruang dimana masing masing unsur dasar pembuatan peta tersebut sudah ditandai sesuai dengan kode wilayah administrasi yang tersimpan dalam media komputer. ', '0.0000', '0.000', '0.000', '0.010', '0.010', '0.010', 'Semua', 'Semua'),
(116, 3800, 'Ahli', 2, 'II.A.17.', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.A. Persiapan ', 'II.A.17. Mengelola peta digital ', 'Mengelola peta digital ', '', 'Peta', 'Laporan pengelolaan peta digital suatu wilayah yang dilegalisasi oleh atasan ', '0.060', 'Pertama', 'Mengelola peta adalah kegiatan memelihara, mendokumentasikan (membuat katalog, mencatat penggunaan peta oleh berbagai pihak) dalam media tertentu, dan melakukan pemutakhiran (update) peta dalam periode 1 tahun. Peta yang dinilai adalah peta yang dimutakhirkan. ', '0.0000', '0.000', '0.000', '0.060', '0.060', '0.060', 'Semua', 'Semua'),
(117, 3900, 'Ahli', 2, 'II.A.18.', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.A. Persiapan ', 'II.A.18. Melakukan pengawasan pemetaan ', 'Melakukan pengawasan pemetaan ', '', 'Peta', 'Surat tugas dan laporan banyaknya peta yang di awasi yang dilegalisasi atasan ', '0.030', 'Pertama', 'Melakukan pengawasan pemetaan adalah kegiatan mengawasi, mencocokkan antara peta yang sudah dibuat (termasuk legenda, batas-batas yang sudah dibuat dipeta dan unsur unsur di dalam peta) dengan keadaan yang sesungguhnya dilapangan dalam rangka kegiatan statistik. ', '0.0000', '0.000', '0.000', '0.030', '0.030', '0.030', 'Semua', 'Semua'),
(118, 4000, 'Ahli', 2, 'II.A.19.a', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.A. Persiapan ', 'II.A.19. Memeriksa hasil penarikan sampel kegiatan observasi berdasarkan:  ', 'Memeriksa hasil penarikan sampel a. Wilayah Kerja ', '', 'Daftar Sampel', 'Laporan hasil pemeriksaan penarikan sampel yang dilegalisasi oleh atasan ', '0.040', 'Muda', 'Wilayah kerja adalah wilayah administrasi atau wilayah yang dibentuk untuk keperluan penelitian yang batasnya sudah ditentukan. Penarikan sampel berdasarkan wilayah kerja adalah kegiatan penarikan sampel yang objek observasinya didasarkan pada wilayah kerja. Memeriksa hasil penarikan sampel kegiatan observasi berdasarkan wilayah kerja adalah memeriksa kebenaran hasil pemilihan sampel (daftar sampel) sesuai batas wilayah kerja dan metode yang sudah ditentukan, seperti kelengkapan, kebenaran nama dan alamat serta indikator lainnya. Yang mendapatkan penilaian angka kredit adalah petugas pemeriksa yang bukan petugas penarik sampel tersebut. ', '0.0000', '0.000', '0.000', '0.032', '0.040', '0.040', 'Semua', 'Semua'),
(119, 4100, 'Ahli', 2, 'II.A.19.b', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.A. Persiapan ', 'II.A.19. Memeriksa hasil penarikan sampel kegiatan observasi berdasarkan:  ', 'Memeriksa hasil penarikan sampel b. Non Wilayah Kerja ', '', 'Daftar Sampel', 'Laporan hasil pemeriksaan penarikan sampel yang dilegalisasi oleh atasan ', '0.010', 'Pertama', 'Penarikan sampel berdasarkan non wilayah kerja adalah kegiatan penarikan sampel yang objek observasinya tidak didasarkan pada wilayah kerja tetapi langsung didasarkan pada daftar/direktori objek observasi. Memeriksa penarikan sampel obyek observasi berdasarkan non wilayah kerja yang dimaksud adalah memeriksa kebenaran penarikan sampel sesuai metode yang sudah ditentukan, seperti kelengkapan, kebenaran nama dan alamat serta indikator lainnya yang diperlukan sebagai dasar pemilihan sampel berdasarkan non wilayah kerja. Yang mendapatkan penilaian angka kredit adalah petugas pemeriksa yang bukan petugas penarik sampel tersebut. Obyek observasi berdasarkan non wilayah kerja yang dimaksud adalah obyek observasi yang didasarkan tidak pada batasan wilayah (bisa antar wilayah) yang pada umumnya sudah ditentukan sebelumnya. Dalam kegiatan ini termasuk pemeriksaan hasil penarikan sampel kegiatan survei. ', '0.0000', '0.000', '0.000', '0.010', '0.010', '0.010', 'Semua', 'Semua'),
(120, 5000, 'Ahli', 2, 'II.B.3.a', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.B. Pengumpulan Data ', 'II.B.3. Melakukan pengawasan pada kegiatan statistik objek rumah tangga ', 'Pengawasan rumah tangga Kuesioner sederhana', '', 'Rumah tangga', 'Laporan hasil pengawasan pelaksanaan sensus atau survei yang dilegalisasi atasan ', '0.001', 'Pertama', 'Melakukan pengawasan pada kegiatan statistik objek rumah tangga adalah melakukan kegiatan pengawasan pada pendataan rumah tangga. Jumlah objek rumah tangga yang diawasi pada umumnya sekitar 20 persen dari total rumah tangga yang dicacah. ', '0.0000', '0.000', '0.000', '0.001', '0.001', '0.001', 'Semua', 'Semua'),
