(144, 7901, 'Ahli', 2, 'II.D.6.', 'II. PENYEDIAAN DATA DAN INFORMASI STATISTIK ', 'II.D. Penyajian dan Publikasi ', 'II.D.6. Menyajikan metadata statistik ', 'Menyajikan metadata statistik ', '', 'Buku', 'Laporan kegiatan penyusunan metadata disertai cover dan daftar isi yang dilegalisasi atasan ', '1.500', 'Pertama', 'Metadata adalah informasi terstruktur yang mendeskripsikan, menjelaskan, menemukan, atau setidaknya membuat menjadikan suatu informasi mudah untuk ditemukan kembali, digunakan atau dikelola. Menyajikan metadata statistik adalah kegiatan membuat metadata dalam kegiatan statistik di suatu institusi dan dipublikasikan (misalnya metadata indikator, metadata konsep dan definisi, metadata publikasi, metadata kegiatan survei, dan sebagainya). ', '0.0000', '0.000', '0.000', '1.500', '1.500', '1.500', 'Semua', 'Semua'),
