(146, 8011, 'Ahli', 2, 'III.A.2.', 'III. ANALISIS DAN PENGEMBANGAN STATISTIK', 'III.A. Analisis Statistik ', 'III.A.2.Membuat inovasi statistik dalam rangka penyusunan kegiatan statistik ', 'Membuat inovasi statistik dalam rangka penyusunan kegiatan statistik : ', '', 'Naskah', 'Naskah hasil inovasi statistik berupa hardcopy dan softcopy yang dilegalisasi oleh atasan dan surat keterangan pengakuan hasil inovasi oleh instansi pembina jabatan fungsional statistisi. ', '7.900', 'Utama', 'Membuat inovasi statistik dalam rangka penyusunan kegiatan statistik merupakan penemuan, penyempurnaan, atau pembaharuan suatu metode atau teknik statistik yang telah diakui dan atau digunakan dalam kegiatan statistik. Inovasi tersebut dituangkan dalam bentuk naskah ilmiah yang berisi latar belakang, permasalahan, studi literatur, metodologi, pembahasan inovasi, kesimpulan, rekomendasi, dan daftar pustaka/referensi. ', '0.0000', '0.000', '0.000', '0.000', '0.000', '6.320', 'Semua', 'Semua'),
(147, 8020, 'Ahli', 2, 'III.A.3.', 'III. ANALISIS DAN PENGEMBANGAN STATISTIK', 'III.A. Analisis Statistik ', 'III.A.3.Membuat estimasi parameter dalam rangka penyusunan statistik kelembagaan ', 'Membuat estimasi parameter dalam rangka penyusunan statistik kelembagaan : ', '', 'Paket estimasi', 'Laporan estimasi parameter berisi ringkasan metode, hasil dan evaluasi estimasi yang dilegalisasi oleh atasan. ', '0.600', 'Muda', 'Membuat estimasi parameter dalam rangka penyusunan statistik kelembagaan adalah menyusun estimasi karakteristik populasi (parameter) berdasarkan hasil survei/observasi dan mengevaluasi hasilnya. Termasuk kegiatan ini adalah estimasi PDB/PDRB dan membuat angka ramalan data statistik. ', '0.0000', '0.000', '0.000', '0.480', '0.600', '0.600', 'Semua', 'Semua'),
(148, 8031, 'Ahli', 2, 'III.A.4.', 'III. ANALISIS DAN PENGEMBANGAN STATISTIK', 'III.A. Analisis Statistik ', 'III.A.4.Membuat outline untuk publikasi ', 'Membuat outline untuk publikasi : ', '', 'Buku (naskah outline)', 'Laporan penyusunan outline dan dilampiri outline yang dilegalisasi oleh atasan', '0.360', 'Muda', 'Outline adalah inti dari sebuah tulisan atau rencana penulisan. Membuat outline untuk publikasi adalah menyusun rencana penulisan untuk sebuah publikasi hasil kegiatan statistik.', '0.0000', '0.000', '0.000', '0.288', '0.360', '0.360', 'Semua', 'Semua'),
(149, 8041, 'Ahli', 2, 'III.A.5.', 'III. ANALISIS DAN PENGEMBANGAN STATISTIK', 'III.A. Analisis Statistik ', 'III.A.5.Mengumpulkan literature/referensi untuk publikasi ', 'Mengumpulkan literature/referensi untuk publikasi : ', '', 'Buku (daftar pustaka)', 'Laporan pengumpulan literatur/referensi dan dilampiri daftar pustaka yang dilegalisasi oleh atasan', '0.360', 'Muda', 'Literature/referensi adalah sumber acuan atau rujukan, berupa buku atau laman resmi suatu institusi. Mengumpulkan literature/referensi untuk publikasi adalah mengumpulkan sumber acuan atau rujukan yang terkait dengan topik publikasi dan dituliskan dalam daftar pustaka. ', '0.0000', '0.000', '0.000', '0.288', '0.360', '0.360', 'Semua', 'Semua'),
(150, 8051, 'Ahli', 2, 'III.A.6.a', 'III. ANALISIS DAN PENGEMBANGAN STATISTIK', 'III.A. Analisis Statistik ', 'III.A.6.Melakukan analisis sederhana lintas sektor ', 'Melakukan analisis sederhana lintas sektor Sesuai ketentuan: ', '', 'Buku (Naskah)', 'Laporan penyusunan analisis statistik sederhana lintas sektor dan dilampiri dengan fotocopy buku (naskah) yang dilegalisasi oleh atasan ', '1.900', 'Pertama', 'Analisis statistik sederhana lintas sektor adalah penguraian lebih dari satu sektor atas berbagai bagian dan penelaahan yang saling terkait untuk memperoleh gambaran yang jelas. Yang dimaksud dengan sektor adalah lingkup permasalahan yang dianalisis. Contoh: sektor pendidikan, sektor tenaga kerja, sektor perdagangan, sektor pertanian, dan lain lain. Sistematika penulisan analisis memuat minimal abstraksi, pendahuluan, permasalahan, metodologi, pembahasan, kesimpulan, dan daftar pustaka/referensi dengan jumlah halaman minimal 25 halaman. Jika analisis sederhana lintas sektor berupa buku dengan sistematika penulisan analisis tidak sesuai ketentuan di atas maka diberikan nilai sebesar 50 (lima puluh) persen dari 1,9. Jika analisis sederhana lintas sektor merupakan bagian dari buku atau berupa ulasan singkat minimal 3 halaman maka diberikan nilai sebesar 10 (sepuluh) persen dari 1,9. ', '0.0000', '0.000', '0.000', '1.900', '1.900', '1.900', 'Semua', 'Semua'),
