(172, 8501, 'Ahli', 2, 'III.B.7.', 'III. ANALISIS DAN PENGEMBANGAN STATISTIK', 'III.B. Pengembangan Statistik ', 'III.B.7.Menyusun rencana induk (master plan) Sistem Statistik Nasional (SSN) ', 'Menyusun rencana induk (master plan) Sistem Statistik Nasional (SSN) : ', '', 'Naskah', 'Naskah rencana induk berupa hardcopy dan softcopy. ', '25.000', 'Utama', 'Sistem Statistik Nasional (SSN) adalah suatu tatanan yang terdiri atas unsur unsur kebutuhan data statistik, sumber daya, metode (sensus, survei, observasi, kompilasi, dan sebagainya), sarana dan prasarana, ilmu pengetahuan dan teknologi, perangkat hukum, dan forum masyarakat statistik yang secara teratur saling berkaitan sehingga membentuk totalitas penyelenggaraan statistik. SSN adalah dokumen resmi. Dalam SSN, BPS bertindak selaku inisiator dalam rangka Koordinasi, Integrasi, Sinkronisasi, dan Standardisasi (KISS) di Indonesia. Menyusun rencana induk adalah menyusun rencana pokok/dasar secara menyeluruh suatu kegiatan dalam waktu tertentu. Misalnya Sigma Plan BPS tahun 2010 2015. ', '0.0000', '0.000', '0.000', '0.000', '0.000', '20.000', 'Semua', 'Semua'),
(173, 8601, 'Ahli', 2, 'III.B.8.', 'III. ANALISIS DAN PENGEMBANGAN STATISTIK', 'III.B. Pengembangan Statistik ', 'III.B.8.Melakukan revitalisasi rencana induk SSN sesuai kemajuan teknologi dan ilmu pengetahuan ', 'Melakukan revitalisasi rencana induk SSN sesuai kemajuan teknologi dan ilmu pengetahuan : ', '', 'Naskah', 'Naskah revitalisasi dan surat keterangan keterlibatan statistisi dalam kegiatan revitalisasi dari atasan ', '10.000', 'Utama', 'Revitalisasi adalah upaya untuk menghidupkan atau menggiatkan kembali suatu program kegiatan yang sebelumnya kurang terberdaya atau kurang mengikuti kemajuan ilmu pengetahuan dan teknologi. Kegiatan yang dilakukan meliputi merancang revitalisasi dan menyusun naskah yang memuat gagasan serta terlibat langsung dalam kegiatan revitalisasi tersebut. ', '0.0000', '0.000', '0.000', '0.000', '0.000', '8.000', 'Semua', 'Semua'),
(174, 8701, 'Ahli', 2, 'III.B.9.', 'III. ANALISIS DAN PENGEMBANGAN STATISTIK', 'III.B. Pengembangan Statistik ', 'III.B.9.Melakukan evaluasi SSN yang sedang berjalan ', 'Melakukan evaluasi SSN yang sedang berjalan : ', '', 'Naskah', 'Naskah evaluasi dan surat tugas dari atasan ', '10.000', 'Utama', 'Melakukan evaluasi SSN yang sedang berjalan adalah melakukan penilaian untuk menentukan kualitas SSN yang sedang berjalan terhadap berbagai faktor yang berpengaruh (penghambat, peluang, kelemahan, kelebihan) sehingga hasilnya dapat digunakan untuk melakukan penyempurnaan/revitalisasi. ', '0.0000', '0.000', '0.000', '0.000', '0.000', '8.000', 'Semua', 'Semua'),
(175, 8801, 'Ahli', 2, 'III.B.10.', 'III. ANALISIS DAN PENGEMBANGAN STATISTIK', 'III.B. Pengembangan Statistik ', 'III.B.10.Melakukan kajian terhadap perkembangan dan pemanfaatan statistik secara internasional ', 'Melakukan kajian terhadap perkembangan dan pemanfaatan statistik secara internasional : ', '', 'Naskah', 'Naskah kajian berupa hardcopy dan softcopy ', '5.000', 'Utama', 'Melakukan kajian terhadap perkembangan dan pemanfaatan statistik secara internasional adalah melakukan kajian yang mencakup aspek metodologi dan aspek penggunaan/pemanfaatan data statistik dalam lingkup beberapa negara. Kajian tersebut dituangkan dalam bentuk naskah yang berisi latar belakang, permasalahan, studi literatur, metodologi, pembahasan, kesimpulan, rekomendasi, dan daftar pustaka/referensi. ', '0.0000', '0.000', '0.000', '0.000', '0.000', '4.000', 'Semua', 'Semua'),
