INSERT INTO `quote` (`id`, `teks`, `orang`, `tempat`) VALUES
(1, 'Kalau kau ingin managis karena gagal ,beralatihlah lebih keras lagi, sehingga kau pantas menangis ketika kau gagal', 'megumi takani', 'samurai x'),
(2, 'Jaman bisa terus berubah, tekhnologi bisa bertambah canggih, tapi manusia akan tetap menjadi manusia', 'QED', ''),
(3, 'Seperti itulah seorang kapten. jika pemimpin terlalu lunak, kepada siapa lagi kita harus percaya?', 'Zorro', 'One Piece'),
(4, 'Kita tidak mungkin jadi ninja kalau tidak mau berkorban', 'Momochi Zabuza', 'Naruto'),
(5, 'Kemampuan individu memang penting. Tapi yang lebih penting adalah kemampuan kerjasama.', 'Hatake Kakashi', 'Naruto'),
(6, 'Yang penting bukanlah dari mana kamu dapat pengetahuan itu.\nTapi di mana kamu bisa menerapkannya.', 'Ai Haibara', 'Detective Conan'),
(7, 'Bermimpilah, karena Tuhan akan memeluk mimpi-mimpi itu', 'Sang Pemimpi', ''),
(8, 'You can\'t always get what you want, but, if you try, sometimes you just might find you get what you need', 'Manusia Setengah Salmon', ''),
(9, 'Hiduplah untuk memberi yang sebanyak-banyaknya, bukan untuk menerima yang sebanyak-banyaknya', 'Laskar Pelangi', ''),
(10, 'Tertawalah, seisi dunia akan tertawa bersamamu; jangan bersedih karena kau hanya akan bersedih sendirian', 'Edensor', ''),
(11, 'Kadang-kadang langit bisa kelihatan seperti lembar kosong. Padahal sebenarnya tidak. Bintang kamu tetap di sana. Bumi hanya sedang berputar', 'Perahu Kertas', ''),
(12, 'Pendidikan mempunyai akar yang pahit, tapi buahnya manis', 'Aristoteles', ''),
(13, 'Pendidikan mengembangkan kemampuan, tetapi tidak menciptakannya', 'Voltaire', ''),
(14, 'Pendidikan yang baik tidak menjamin pembentukan watak yang baik', 'Fonttenelle', ''),
(15, 'Dengan kekuatan yang besar, akan datang tanggung jawab yang besar juga', 'Ben Parker', 'Spiderman'),
(16, 'Ketika Tuhan mengambil sesuatu dari genggamanmu, Dia tak menghukummu, namun hanya membuka tanganmu tuk menerima yg lebih baik', '', 'Film: 5 CM'),
(17, 'Hidup itu sederhana. Ketika sudah membuat pilihan, tidak perlu menoleh kebelakang ', '', 'Film: Tokyo Drift'),
(18, 'Lakukan atau tidak. Tidak ada kata mencoba-coba', 'Yoda', 'The Empire Strikes Back'),
(19, 'Apa yang sudah kamu pilih, harus kamu selesaikan dengan baik', 'Merry Riana ', 'Mimpi Sejuta Dollar'),
(20, 'I will fight until the end and never give up', 'Merry Riana ', 'Mimpi Sejuta Dollar'),
(21, 'A man who doesn\'t spend time with his family can never be a real man', 'Don Corleone', 'The Godfather'),
(22, 'Life would knock us down, but we can choose wheter or not to get back up', 'Mr. Han', 'Karate Kid'),
(23, 'If you good at something don\'t do it for free', 'joker', 'the dark knight'),
(24, 'No place for weakness', 'Leonidas', '300'),
(25, 'Kapan seorang manusia mati? Saat mereka menderita penyakit yang tidak bisa disembuhkan? Bukan! Saat jantung mereka tertembak peluru? Bukan! Saat mereka memakan jamur beracun? Juga bukan! Tapi saat mereka telah dilupakan oleh orang lain', 'Dr. Hiluluk', 'One Piece'),
(26, 'Berputus asa, mengeluh, berdiam diri, apa gunanya? Kalau berdiam diri, mayat juga bisa', 'Ciel Phantomhive', 'Black Butler'),
(27, 'Banyak orang gagal karena mereka tidak memahami usaha yang diperlukan untuk menjadi sukses.', 'Yukino Yukinoshita', 'Oregairu'),
(28, 'Kalau belum apa-apa sudah menyerah, percuma saja kau hidup', 'Tachibana', 'The Draft of Citrus'),
(29, 'Tidaklah bijak untuk menilai orang lain berdasarkan penilaianmu sendiri dan oleh penampilan mereka', 'Itachi', 'Naruto'),
(30, 'Banyak hal yang bisa menjatuhkanmu. Tapi satu-satunya hal yang benar-benar dapat menjatuhkanmu adalah sikapmu sendiri', 'RA Kartini', ''),
(31, 'Lawan sastra ngesti mulya (Dengan ilmu kita menuju kemuliaan)', 'Ki Hadjar Dewantara', ''),
(32, 'Jelas sekali bahwasanya rumah tangga yang aman damai ialah gabungan di antara tegapnya laki-laki dan halusnya perempuan', 'Hamka', ''),
(33, 'Try not to become a person of success, but rather try to become a person of value', 'Albert Einstein', ''),
(34, 'I have not failed. Ive just found 10,000 ways that wont work', 'Thomas A. Edison', '');
